import React from 'react'
import Navbar from "../../Components/Navbar/Navbar"

function MY_Account() {
  return (
    <div>
      <Navbar/>
      <div className='MyAccContainer'>
       <h1>My Account</h1>
       <div>
        <Box1/>
        <hr />
        <Box2/>
        <hr />
        <Box3/>
        <hr />
        <Box4/>
        <hr />
        <Box4/>
        <Box4/>
       </div>

      </div>
    
    </div>
  )
}
const Box1 = () => {
  return (
    <div style={{ backgroundColor: "#f0f0f0", padding: "20px",  }}>
      <h2>Box 1</h2>
      <p>This is the content for Box 1.</p>
    </div>
  );
};

const Box2 = () => {
  return (
    <div style={{ backgroundColor: "#e0e0e0", padding: "20px",  }}>
      <h2>Box 2</h2>
      <p>This is the content for Box 2.</p>
    </div>
  );
};const Box3 = () => {
